import gql from "graphql-tag";
const COUNT_VIEW_PROJECT = gql`
  mutation projectViewUpdate ($input: UpdateProjectViewInput!) {
    projectViewUpdate (input: $input) {
      id
      view_count
    }
  }
`;

export {
  COUNT_VIEW_PROJECT
}
